import React from 'react'
import TaskItem from './TaskItem';

const TaskList = ( {allTasks}) => {

  return(
    <div className="taskList">
      <ul>
        {allTasks.map((task, index) => {
          return <TaskItem task={task} key={index} index={index} />
        })}

      </ul>
    </div>
  )
}


export default TaskList;
